import "./App.css";

function App() {
  function fJsGrid() {
    let data = [];
    for (let i = 0; i < 10; i++) {
      data.push([]);
      for (let j = 0; j < 10; j++) {
        data[i].push(0);
      }
    }
    // console.table(data);
    return data;
  }
  let jsGrid = fJsGrid();
  // console.table(jsGrid);
  return (
    <div className="App">
      {jsGrid.map((row, rowIndex) =>
        row.map((col, colIndex) => (
          <div
            style={{ width:"fit-content", backgroundColor: "red" }}
          >{`${rowIndex}-${colIndex}`}</div>
        ))
      )}
    </div>
  );
}

export default App;
